package bitcoin

import (
	"encoding/hex"
	"testing"

	"github.com/btcsuite/btcd/blockchain"
	"github.com/btcsuite/btcd/btcutil"
	"github.com/btcsuite/btcd/wire"
	"github.com/stretchr/testify/require"
)

func TestTransactionWeight(t *testing.T) {
	require := require.New(t)
	b, _ := hex.DecodeString(PSBT)
	psbt, err := UnmarshalPartiallySignedTransaction(b)
	require.Nil(err)

	tx := btcutil.NewTx(psbt.UnsignedTx)
	weight := blockchain.GetTransactionWeight(tx)
	require.Equal(int64(10164), weight)
	require.Equal(57, len(tx.MsgTx().TxIn))

	raw, err := MarshalWiredTransaction(tx.MsgTx(), wire.BaseEncoding, ChainBitcoin)
	require.Nil(err)
	require.Equal(2541, len(raw))

	vb := psbt.EstimateVirtualSize()
	require.Equal(6303, vb)
}

const PSBT = ""
